import {useState} from 'react';
import useSWR from 'swr';
import Button from './Button';
type childProps={
dataToGet:Function;
}
const NavBar = ({dataToGet}:childProps) =>{
    const [data,changeData]=useState<string>();
    const captureData=(e: React.FormEvent<HTMLInputElement>)=>{

        changeData(e.currentTarget.value);
     }
const clickFnc=()=>{
    useSWR(`https://api.unsplash.com/search/photos?page=1&query=${data}&client_id=${process.env.REACT_APP_API_KEY}`)
}
return(
    <div className="navBar--nav">
        <h1 className="navBar--a">Photo-Pie</h1>
    <div className="navbar--search">
        <input type="text" placeholder="Search" onChange={captureData}/>
        <Button text="Search" onclick={clickFnc}/>
    </div>
    </div>
)
}

export default NavBar;
